import React, { useState } from 'react';
import { View, Text, TouchableOpacity, TextInput, ScrollView, StyleSheet } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { MaterialIcons } from '@expo/vector-icons';

const MedicalConditionsComponent = () => {
  const navigation = useNavigation();

  const [selectedConditions, setSelectedConditions] = useState([]);
  const [newCondition, setNewCondition] = useState('');

  const addCondition = (condition) => {
    setSelectedConditions([...selectedConditions, condition]);
  };

  const removeCondition = (condition) => {
    const updatedConditions = selectedConditions.filter((c) => c !== condition);
    setSelectedConditions(updatedConditions);
  };

  const renderConditions = () => {
    return selectedConditions.map((condition, index) => (
      <View key={index} style={styles.conditionBox}>
        <Text>{condition}</Text>
        <TouchableOpacity onPress={() => removeCondition(condition)}>
          <Text style={styles.removeButton}>X</Text>
        </TouchableOpacity>
      </View>
    ));
  };

  const handleSelectConditions = () => {
    // Open a modal or navigate to a new screen to display the list of medical conditions
    // For simplicity, I'm using an alert here
    alert('List of Medical Conditions: Red, Gallstones, Soil, Heart Muscle, Infertility in Men, Infertility in Women, Chronic Instability of the Ankle, Alzheimer\'s Disease, Endometriosis, Insulin, Asthma of the Skin in Children, Hammer Finger, Epilepsy, Genetic Tests for Hereditary Eye Diseases, Pap Test, Leg Length Problems, Shoulder Problems, BMI Problems in Children, Diaphragmatic Hernia, Hernia in the Abdominal Wall and Groin, Adrenal Nodules, Nodules in the Thyroid Gland, Tumors in the Esophagus, Tumors in the Pleural Space, Pancreatic Tumors, Benign Growth, Tumors in the Anterior Strait, Tumors in the Head, Tumors in the Chest Wall, Tumors in the Colon and Rectum, Pills, Itching in the Vaginal Blood');
  };

  return (
    <View style={styles.container}>
      <TouchableOpacity onPress={handleSelectConditions} style={styles.selectConditionsButton}>
        <Text style={styles.selectConditionsButtonText}>Select Medical Conditions</Text>
        <MaterialIcons name="check-circle" size={24} color="yellow" />
      </TouchableOpacity>

      {/* Display selected conditions */}
      <View style={styles.selectedConditionsContainer}>{renderConditions()}</View>

      {/* Input for adding new condition */}
      <View style={styles.inputContainer}>
        <TextInput
          style={styles.input}
          placeholder="Add a new medical condition"
          value={newCondition}
          onChangeText={(text) => setNewCondition(text)}
        />
        <TouchableOpacity onPress={() => addCondition(newCondition)}>
          <Text style={styles.addButton}>Add</Text>
        </TouchableOpacity>
      </View>

      {/* Login button */}
      <TouchableOpacity style={styles.loginButton}>
        <Text style={{ color: 'white' }}>Login</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
  },
  selectConditionsButton: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginBottom: 20,
    backgroundColor: 'yellow',
    padding: 15,
    borderRadius: 10,
    alignItems: 'center',
  },
  selectConditionsButtonText: {
    color: 'black',
    fontSize: 18,
    fontWeight: 'bold',
  },
  selectedConditionsContainer: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    marginVertical: 10,
  },
  conditionBox: {
    backgroundColor: '#e0e0e0',
    borderRadius: 20,
    padding: 10,
    margin: 5,
    flexDirection: 'row',
    alignItems: 'center',
  },
  removeButton: {
    marginLeft: 5,
    color: 'red',
  },
  inputContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginVertical: 10,
  },
  input: {
    flex: 1,
    borderWidth: 1,
    borderRadius: 10,
    padding: 10,
    marginRight: 10,
  },
  addButton: {
    color: 'blue',
  },
  loginButton: {
    backgroundColor: 'blue',
    borderRadius: 10,
    padding: 15,
    alignItems: 'center',
    marginTop: 20,
  },
});

export default MedicalConditionsComponent;


